(1, 'maksim', 'Весьма легко и приятно было работать с этой командой. Адекватные, понимающие задачи и грамотные люди. Поверьте опыту - есть с кем сравнивать. На рынке полно &quot;деятелей&quot; которые умеют делать типовые задачи, а когда нужно что-то особенное - тупят или заламывают цену чтобы сам отказался. Эти, повторюсь, совсем не такие. ', '94.232.75.203', '1489065822');
