INSERT INTO `igolia_page_content` (`id`, `lang`, `page_name`, `content`) VALUES
(1, 'ru', 'index', 'Веб студия "Igolia" начала свою деятельность 9 июля 2016р. в г. Кривой Рог. Сегодня "Igolia" - это компания, с которой сотрудничают как государственные, так и частные предприятия из всей Украины. Мы разработали большое количество веб проектов, вносили правки в чужие сайты, отрисовывали логотипы, в частности дизайы.\r\nВажнейшим в разработке веб проектов мы считаем надежную программную часть и удобный интерфейс управления сайтом. Также достаточно большое внимание уделяем внешнему виду сайтов, что очень часто для заказчиков является основным критерием отбора. Опыт работы наших программистов и верстальщиков больше 3 лет на рынке и большое количество качественно произведенных работ разной сложности. Относительно профессионализма дизайнеров : смотрите наши работы в портфолио.'),
(2, 'ua', 'index', 'Веб студія "Igolia" почала свою дiяльнiсть 9 липня 2016р. у Кривому Розі. Сьогодні "Igolia" - це компанія, з якою співпрацюють як державні, так і приватні підприємства з усієї України. Ми розробили велику кількість веб проектів, вносили правки в чужі сайти, малювали логотипи, зокрема дізайе.\nНайважливішим в розробці веб проектів ми вважаємо надійну програмну частину і зручний інтерфейс управління сайтом. Також досить велику увагу приділяємо зовнішньому вигляду сайтів, що дуже часто для замовників є основним критерієм відбору. Досвід роботи наших програмістів і верстальників більше 3 років на ринку і велику кількість якісно виконаних робіт різної складності. Щодо професіоналізму дизайнерів: дивіться наші роботи в портфоліо.'),
(3, 'en', 'index', 'Web Studio "Igolia" started its activities on July 9 2016r. in Krivoy Rog. Today "Igolia" - is a company that collaborates with both public and private companies from all over Ukraine. We have developed a large number of web projects, to make changes in other people\'s sites, draws logos, especially design creation.\r\nThe most important in the development of web projects, we believe reliable software part and convenient content management interface. It is also big enough attention is paid to the appearance of sites, it is very common for customers is the main selection criterion. Experience our programmers and web designers for more than 3 years on the market and a large number of high quality work performed varying complexity. Regarding professional designers: see our work in the portfolio.'),
(4, 'ru', 'attendance', 'Во-первых, наличие первоклассных специалистов гарантирует профессиональное изготовление сайтов. То есть, все наши сотрудники учтут любые Ваши пожелания и воплотят их в реальные проекты с помощью самых современных технологий.\r\n\r\nВо-вторых, максимально короткие сроки на разработку сайта без потери качества работы.\r\n\r\nИ, наконец, чрезвычайно важный фактор для любого клиента – недорогое изготовление сайтов. Ведь предложений на рынке не мало, но, как правило, от цен кружится голова. Мы ломаем стереотипы,  именно у нас можно заказать сайт недорого. Цена разработки сайта в нашей веб-студии полностью соответствует вложенной в нее сумме, к тому же она не превышает предложения конкурентов. Несмотря на то, что сегодня есть много предложений по разработке сайтов, клиентам сложно подобрать выгодное предложение, которое соответствовало бы желаемому качеству. Благодаря арсеналу технических и кадровых ресурсов, мы можем недорого осуществлять разработку сайтов любого типа. А именно, Вы можете заказать сайт-визитку, которая состоит из нескольких страниц, либо целый интернет магазин с различными модулями.\r\n\r\nНам известно, что каждый клиент решается заказать изготовление сайта, когда уже имеет определенные предпочтения, и представление о том, что он хочет видеть в итоге работы, потому у Вас будет возможность контролировать процесс изготовления сайта и вносить коррективы,  которые  обязательно будут учтены при создании сайта. Исходя из этого, создание какого сайта Вы бы не выбрали, результат будет соответствовать вашим ожиданиям.\r\n\r\nСтав нашим клиентом, Вы можете забыть о таких вопросах как: где сделать сайт компании, где купить сайт и т.д. Ответы на все эти вопросы Вы можете получить в кратчайшие сроки у нас, у веб-студии Igolia.\r\n\r\nЕстественно, что, если клиент хочет заказать веб сайт, он рассчитывает на получение определенного эффекта, в зависимости от предназначения сайта. Потому, при разработке корпоративного сайта или, к примеру, изготовлении интернет магазина, в итоге заказчику будет предоставлена максимально качественная разработка сайта. Только такое изготовление сайтов, оценят по достоинству, ведь веб-ресурс должен быть не только ярким, но и содержательным, эргономичным и привлекательным для клиентов. Мы делаем выгоднейшие предложения. Если Вы все еще сомневаетесь как это возможно, ведь на такую популярную услугу как заказать сайт, то все просто: у наших клиентов есть возможность заказать создание сайта в соответствии со своим бюджетом, а потому с нами сотрудничают как большие компании, так и мелкие предприниматели. Вы можете заказать интернет магазин с множеством функций или, например, мы можем создать сайт визитку в бюджетном варианте. Наша студия не навязывает клиентам услуги, мы предоставляем выбор.\r\n\r\nВсе наши цены на услуги сформированы исходя из реальных затрат на их предоставление и лишены излишних надбавок. Создание сайтов является наилучшим способом продвижения вашего дела, и в наш цифровой век это будет одним из наиэффективнейших вложений в начале вашего бизнеса.'),
(5, 'ua', 'attendance', 'По-перше, наявність першокласних фахівців гарантує професійне виготовлення сайтів. Тобто, всі наші співробітники врахують будь-які Ваші побажання і втілять їх у реальні проекти за допомогою найсучасніших технологій.\r\n\r\nПо-друге, максимально короткі терміни на розробку сайту без втрати якості роботи.\r\n\r\nІ, нарешті, надзвичайно важливий фактор для будь-якого клієнта - недороге виготовлення сайтів. Адже пропозицій на ринку не мало, але, як правило, від цін паморочиться голова. Ми ламаємо стереотипи, саме у нас можна замовити сайт недорого. Ціна розробки сайту в нашій веб-студії повністю відповідає вкладеної в неї сумі, до того ж вона не перевищує пропозиції конкурентів. Незважаючи на те, що сьогодні є багато пропозицій з розробки сайтів, клієнтам складно підібрати вигідну пропозицію, яке відповідало б бажаного якості. Завдяки арсеналу технічних і кадрових ресурсів, ми можемо недорого здійснювати розробку сайтів будь-якого типу. А саме, Ви можете замовити сайт-візитку, яка складається з декількох сторінок, або цілий інтернет магазин з різними модулями.\r\n\r\nНам відомо, що кожен клієнт вирішується замовити виготовлення сайту, коли вже має певні переваги, і уявлення про те, що він хоче бачити в результаті роботи, тому у Вас буде можливість контролювати процес виготовлення сайту і вносити корективи, які обов\'язково будуть враховані при створенні сайту . Виходячи з цього, створення якого сайту Ви б не вибрали, результат буде відповідати вашим очікуванням.\r\n\r\nСтавши нашим клієнтом, Ви можете забути про таких питаннях як: де зробити сайт компанії, де купити сайт і т.д. Відповіді на всі ці питання Ви можете отримати в найкоротші терміни у нас, у веб-студії Igolia.\r\n\r\nПриродно, що, якщо клієнт хоче замовити веб сайт, він розраховує на отримання певного ефекту, в залежності від призначення сайту. Тому, при розробці корпоративного сайту або, наприклад, виготовленні інтернет магазину, в результаті замовнику буде надана максимально якісна розробка сайту. Тільки таке виготовлення сайтів, гідно оцінять, адже веб-ресурс повинен бути не тільки яскравим, але і змістовним, ергономічним і привабливим для клієнтів. Ми робимо найвигідніші пропозиції. Якщо Ви все ще сумніваєтеся як це можливо, адже на таку популярну послугу як замовити сайт, то все просто: у наших клієнтів є можливість замовити створення сайту відповідно до свого бюджетом, а тому з нами співпрацюють як великі компанії, так і дрібні підприємці. Ви можете замовити інтернет магазин з безліччю функцій або, наприклад, ми можемо створити сайт візитку в бюджетному варіанті. Наша студія не нав\'язує клієнтам послуги, ми надаємо вибір.\r\n\r\nВсі наші ціни на послуги сформовані виходячи з реальних витрат на їх надання та позбавлені зайвих надбавок. Створення сайтів є найкращим способом просування вашої справи, і в наш цифровий вік це буде одним з наіеффектівнейшій вкладень на початку вашого бізнесу.'),
(6, 'en', 'attendance', 'First, the availability of first-class specialists guarantees professional production of sites. That is, all our employees will take into account any of your wishes and translate them into real projects using the most modern technologies.\r\n\r\nSecondly, the shortest possible time for the development of the site without loss of quality of work.\r\n\r\nAnd, finally, an extremely important factor for any customer is inexpensive site manufacturing. After all, the offers on the market are not small, but, as a rule, the head is dizzy from the prices. We break stereotypes, we can order a cheap website. The price of development of a site in our web-studio completely corresponds to the amount invested in it, besides it does not exceed the offer of competitors. Despite the fact that today there are many proposals for the development of sites, it is difficult for clients to choose an advantageous offer that would correspond to the desired quality. Thanks to the arsenal of technical and human resources, we can inexpensively carry out development of sites of any type. Namely, you can order a website-business card, which consists of several pages, or an entire online store with various modules.\r\n\r\nWe know that every client decides to order the production site, when he already has certain preferences, and the idea of ​​what he wants to see as a result of the work, because you will have the opportunity to control the process of making the site and make adjustments that will be taken into account when creating the site . Based on this, the creation of any site you would not choose, the result will meet your expectations.\r\n\r\nBecoming our client, you can forget about such issues as: where to make a company\'s website, where to buy a website, etc. The answers to all these questions you can get in the shortest time with us, the web studio Igolia.\r\n\r\nNaturally, if a customer wants to order a web site, he expects to receive a certain effect, depending on the purpose of the site. Therefore, when developing a corporate website or, for example, making an online store, in the end, the customer will be given the highest quality development of the site. Only such manufacture of sites, will appreciate, after all the web resource should be not only bright, but also substantial, ergonomic and attractive to clients. We make advantageous offers. If you still doubt as it is possible, after all, for such a popular service as to order a website, it\'s simple: our customers have the opportunity to order the creation of a site in accordance with their budget, and therefore both large companies and small entrepreneurs cooperate with us. You can order an online store with many functions or, for example, we can create a business card site in a budget variant. Our studio does not impose services on clients, we provide a choice.\r\n\r\nAll our prices for services are formed on the basis of real costs for their provision and are not subject to excessive surcharges. Website creation is the best way to promote your business, and in our digital age this will be one of the most effective investments at the beginning of your business.');
