(139, 'Adobe Photoshop — многофункциональный графический редактор, разработанный и распространяемый фирмой Adobe Systems. В основном работает с растровыми изображениями. Продукт является лидером рынка в области коммерческих средств редактирования растровых изображений и наиболее известным продуктом фирмы Adobe', 'Adobe Photoshop — багатофункціональний графічний редактор, розроблений і поширюваний фірмою Adobe Systems. В основному працює з растровими зображеннями. Продукт є лідером ринку в області комерційних засобів редагування растрових зображень і найбільш відомим продуктом фірми Adobe', 'Adobe Photoshop — multifunctional editing software, developed and distributed by Adobe Systems. Mainly it is working with raster images. The product is in commercial funds area market leader editing bitmaps and most famous company Adobe product'),
(140, 'Adobe Illustrator — векторный графический редактор, разработанный и распространяемый фирмой Adobe Systems', 'Adobe Illustrator - векторний графічний редактор, розроблений і поширюваний фірмою Adobe Systems', 'Adobe Illustrator - vector editing software developed and distributed by Adobe Systems'),
(141, 'Node.js — это JavaScript-окружение построеное на JavaScript-движке Chrome V8. Node.js использует событийную, неблокирующий I/O модель, делающую его легким и эффективным. Пакетная экосистема Node.js — npm, является крупнейшей в мире экосистемой библиотек с открытым кодом', 'Node.js - це JavaScript-оточення збудована на JavaScript-движку Chrome V8. Node.js використовує подієву, неблокірующій I / O модель, що робить його легким і ефективним. Пакетна екосистема Node.js - npm, є найбільшою в світі екосистемою бібліотек з відкритим кодом', 'Node.js — is a JavaScript runtime built on Chrome\'s V8 JavaScript engine. Node.js uses an event-driven, non-blocking I/O model that makes it lightweight and efficient. Node.js\' package ecosystem — npm, is the largest ecosystem of open source libraries in the world'),
(142, 'PHP — это широко используемый язык сценариев общего назначения с открытым исходным кодом. Говоря проще, PHP это язык программирования, специально разработанный для написания web-приложений, исполняющихся на Web-сервере. Аббревиатура PHP означает "Препроцессор Гипертекста"', 'PHP — це широко використовувана мова сценаріїв загального призначення з відкритим вихідним кодом. Говорячи простіше, PHP це мова програмування, спеціально розроблений для написання web-додатків, що виконуються на Web-сервері. Абревіатура PHP означає "Препроцесор Гіпертексту"', 'PHP — a widely used general-purpose scripting language is open source. Put simply, PHP is a programming language designed specifically for writing web-applications running on the Web-server. PHP stands for "Hypertext Preprocessor"'),
(143, 'HTML5 — это не продолжатель языка разметки гипертекста, а новая открытая платформа, предназначенная для создания веб-приложений использующих аудио, видео, графику, анимацию и многое другое', 'HTML5 - це не продовжувач мови розмітки гіпертексту, а нова відкрита платформа, призначена для створення веб-додатків використовують аудіо, відео, графіку, анімацію та багато іншого', 'HTML5 - this is not the successor of the hypertext markup language, and a new open platform for creating web applications using audio, video, graphics, animations, and more'),
(144, 'CSS3 — каскадные таблицы стилей третьего поколения, активно разрабатываемая спецификация CSS. Представляет собой формальный язык, реализованный с помощью языка разметки. Самая масштабная редакция по сравнению с CSS1, CSS2 и CSS2.1', 'CSS3 — каскадні таблиці стилів третього покоління, активно розробляється специфікація CSS. Являє собою формальну мову, реалізований за допомогою мови розмітки. Наймасштабніша редакція в порівнянні з CSS1, CSS2 та CSS2.1', 'CSS3 — Cascading style third-generation, are actively developing specification CSS. It is a formal language, implemented using a markup language. The biggest revision compared to CSS1, CSS2 and CSS2.1'),
(145, 'JavaScript — прототипно-ориентированный сценарный язык программирования. Является реализацией языка ECMAScript. JavaScript обычно используется как встраиваемый язык для программного доступа к объектам приложений. Наиболее широкое применение находит в браузерах как язык сценариев для придания интерактивности веб-страницам', 'JavaScript — прототипна-орієнтований сценарний мову програмування. Є реалізацією мови ECMAScript. JavaScript зазвичай використовується як вбудований мова для програмного доступу до об\'єктів додатків. Найбільш широке застосування знаходить в браузерах як мова сценаріїв для додання інтерактивності веб-сторінок', 'JavaScript — prototype-based scenario programming language. Is the implementation ECMAScript language. JavaScript is commonly used as an embedded language for programmatic access to application objects. The most widely used is browsers like scripting language to make interactive web pages'),
(146, 'MySQL — свободная реляционная система управления базами данных. Разработку и поддержку MySQL осуществляет корпорация Oracle. MySQL используется в качестве сервера, к которому обращаются локальные или удалённые клиенты, однако в дистрибутив входит библиотека внутреннего сервера, позволяющая включать MySQL в автономные программы', 'MySQL — вільна реляційна система управління базами даних. Розробка та підтримка сайта MySQL здійснює корпорація Oracle. MySQL використовується як сервер, до якого звертаються локальні або видалені клієнти, проте в дистрибутив входить бібліотека внутрішнього сервера, що дозволяє включати MySQL в автономні програми', 'MySQL — free relational database management system. Development and support for MySQL, Oracle provides. MySQL is used as a server that is accessed by local or remote clients, but in the distribution includes a library of internal server, which allows to include MySQL in standalone program'),
